import styled from 'styled-components';

const ModalContainer = ({ className }) => {
	return (
		<div className={className}>
			<div className="modal-overlay"></div>
			<div className="modal-content"></div>
		</div>
	);
};

export const Modal = styled(ModalContainer)``;
